import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import M from 'materialize-css';
function Account() {
  useEffect(() => {
    var el = document.querySelector('.tabs');
    M.Tabs.init(el);
  }, []);
  let url = ' ';
  return (
    <div className="row">
      <div className="col s12 m12 l12">
        <div className="card">
          <div className="card-content">
            <p>
              I am a very simple card. I am good at containing small bits of
              information. I am convenient because I require little markup to
              use effectively.
            </p>
          </div>
          <div className="card-tabs">
            <ul className="tabs tabs-fixed-width">
              <li className="tab">
                <Link to="/account/personaldetails">Personal Details</Link>
              </li>
              <li className="tab">
                <a className="active" href={url}>
                  Payment Cards
                </a>
              </li>
              <li className="tab">
                <a href={url}>Delivery Address</a>
              </li>
            </ul>
          </div>
          <div className="card-content grey lighten-4">
            <a
              href={url}
              className="waves-effect waves-light btn orange lighten-2"
            >
              <i className="material-icons right">mode_edit</i>Edit
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Account;
